import Icon, { AvailableIcons } from '@/components/atoms/img/Icon';
import React from 'react';

import {
  Container,
  Header,
  Navbar,
  HeaderTextContainer,
  Main,
  Form,
  ProffysList,
} from './styles';

const Proffys: React.FC = () => (
  <Container>
    <Header>
      <Navbar>
        <span>asasd</span>
        <Icon iconName={AvailableIcons.logo} size={60} />
      </Navbar>
      <HeaderTextContainer />
    </Header>
    <Main>
      <Form />
      <ProffysList />
    </Main>
  </Container>
);

export default Proffys;
